text20304.addInnerText('<div id=\"text20304\" style=\"overflow-y:auto;overflow-x:hidden;\"><a id=\"text20304anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.168\" style=\"margin-left:0px;text-indent:0px;line-height:1.168;margin-top:0px;margin-bottom:13px;text-align:justify;\" >\n<span class=\"text20304Font1\"  >Istilah atom sudah muncul sekitar 2500 tahun yang lalu yaitu diperkenalkan oleh Democritus dan merupakan bahasa Yunani, yakni atomos yang berarti partikel terkecil yang tak dapat dibelah atau dibagi. Namun, teori mengenai atom yang didasarkan pada pengamatan hasil eksperimen baru muncul pada tahun 1803 oleh John Dalton. Berdasarkan hasil eksperimen Antoine Lavoisier tentang Hukum Kekekalan Massa dan hasil kerja Joseph Proust tentang Hukum Perbandingan Massa Tetap, Dalton merumuskan teori atom untuk pertama kalinya. Menurut Dalton, atom adalah unit terkecil dari suatu unsur yang dapat melakukan penggabungan kimia.</span ><span class=\"text20304Font2\" style=\"background-color:transparent\" >\n</span ></p >\n</div>\n');
